	<script>
	//$("#submitTeleForm").click(function(e) {
		function submitTeleForm_func() {
		$('.query_commentErr').hide();
		$('.n_nameErr').hide();
		$('.n_EmailErr').hide();
		$('.n_PhoneErr').hide();
		$('.n_passwordErr').hide();
		$('.n_Confirm_PasswordErr').hide();
		$('.emailErr').hide();
		$('.passwordErr').hide();
		//e.preventDefault();
		var form = $("#AskteleForm");
		//alert('HS');
		//$('.otp').show();
		
		
		var qForVal = $("#qFor").val().trim();
        var isValidUsr = true;
        if($('#query_comment').val().trim() == '' && qForVal != 'login' && qForVal != 'signup') {
            $('.query_commentErr').show();
            $('.query_commentErr').text('* Please provide your health query');              
            isValidUsr = false;
        }else{
			$('.query_commentErr').hide();
		}

        var activeTab = $("#activeTab").val();
        if(activeTab == 'new_users') {
            if($('#n_name').val().trim() == '') {
                $('.n_nameErr').show();
                $('.n_nameErr').text('* Please enter your name');
                isValidUsr = false;
            }else{
				$('.n_nameErr').hide();
			}
            if($('#n_Email').val().trim() == '') {
                $('.n_EmailErr').show();
                $('.n_EmailErr').text('* Please enter your email');
                isValidUsr = false;
            }else{
				$('.n_EmailErr').hide();
			}
            if($('#n_Phone').length) {
                if($('#n_Phone').val().trim() == '') {
                    $('.n_PhoneErr').show();
                    $('.n_PhoneErr').text('* Please enter your mobile number');
                    isValidUsr = false;
                }
            }else{
				$('.n_PhoneErr').hide();
			}
            if($('#n_password').val().trim() == '') {
                $('.n_passwordErr').show();
                $('.n_passwordErr').text('* Please enter your password');
                isValidUsr = false;
            }else {
                var isValidPwd = true;
                var pwdVal = $('#n_password').val().trim();

					if(pwdVal.length < 8) {
                        isValidPwd = false;
                    }else if(!/[A-Z]/.test(pwdVal)) {
                        isValidPwd = false;
                    }else if (!/[a-z]/.test(pwdVal)) {
                        isValidPwd = false;
                    }else if (!/[0-9]/.test(pwdVal)) {
                        isValidPwd = false;
                    }else if (!/[\W_ ]/.test(pwdVal)) {
                        isValidPwd = false;
                    }
                
                if(!isValidPwd) {
                    $('.n_passwordErr').show();
                    $('.n_passwordErr').text('* Password should contain at least one numeric character, one symbol or special character and should be a combination of both upper case and lower case alphabets and should contain minimum 8 characters.');
                    isValidUsr = false;
                }else {
                    $('.n_passwordErr').hide();
                    $('.n_passwordErr').text('')
                }
            }
            if($('#n_Confirm_Password').val().trim() == '') {
                $('.n_Confirm_PasswordErr').show();
                $('.n_Confirm_PasswordErr').text('* Please enter the confirm password');
                isValidUsr = false;
            }else {
                var spwd = $('#n_password').val().trim();
                var rpwd = $('#n_Confirm_Password').val().trim();
                if(rpwd != spwd) {
                    $('.n_Confirm_PasswordErr').show();
                    $('.n_Confirm_PasswordErr').text('* Password does not match');
                    isValidUsr = false;
                }
            }
            if($('#activeotTab').val().trim() == 'hot') {
				if($('#otp').val().trim() == '') {
					$('.otpErr').show();
					$('.otpErr').text('* Please enter the OTP');
					isValidUsr = false;
				}
            }
			
            if($('#FieldsetCheck').prop('checked') == false) {
                $('.aler_chktTxt').show();
                $('.aler_chktTxt').text('* Please agree to the terms of use and privacy policy');
                isValidUsr = false;
            }
			// else{
			// 	$('.alert_chkTxt').hide();
			// }
        }else if(activeTab == 'existing_users') {
            if($('#email').val().trim() == '') {
                $('.emailErr').show();
                $('.emailErr').text('* Please enter your email');
                isValidUsr = false;
            }else{
				$('.emailErr').hide();
			}
            if($('#password').val().trim() == '') {
                $('.passwordErr').show();
                $('.passwordErr').text('* Please enter your password');
                isValidUsr = false;
            }else{
				$('.passwordErr').hide();
			}
        }

		var docId = $('#docId').val();

        if(isValidUsr) {
			//alert('submit');
			$.ajax({
				type: "POST",
				url: "/indAskteleForm",
				data: $("#AskteleForm").serialize(),
				//dataType: 'json', // force the ajax request to return json data
				success: function(data){
					//alert(activeTab);
					
					if (activeTab == 'existing_users') {
						var qq = data.data.user_id;
						if (data.message == "Success") {
							window.location.href = "patient-payment/"+qq+"/"+docId;
						}
					} else {
						if (activeTab == 'new_users') {
							if (data.message == "OTP Success") {
								$('#activeotTab').val('hot');
								$('.otp').show();
							}else{
								$('#activeotTab').val('');
								$('#otp').val('');
								$('.otp').hide();
							}
							if (data.message == "Success") {
								let timerInterval
								Swal.fire({
									title: 'Success!',
									html: 'Please refer to your email address.! <br><small>I will close in <b></b> milliseconds.</small>',
									type: "Success",
									timer: 5000,
									timerProgressBar: true,
									showLoaderOnConfirm: true,
									showConfirmButton: false,
									showCancelButton: false,
									didOpen: () => {
										Swal.showLoading()
										const b = Swal.getHtmlContainer().querySelector('b')
										timerInterval = setInterval(() => {
										b.textContent = Swal.getTimerLeft()
										}, 100)
									},
									willClose: () => {
										clearInterval(timerInterval)
									}
								}).then((result) => {
									/* Read more about handling dismissals below */
									if (result.dismiss === Swal.DismissReason.timer) {
										window.location.href = "login";
									}
								})
								//swal("Try Again!", "Please refer to your email address.!", "error");
								//alert("Please check your email");
								//window.location.href = "login";
							}
						}
					}
					
					
				},error:function(data){
					if (data.status == 419) {
						swal("Try Again!", "Something went wrong. Please try again", "error");
						setTimeout(function() {
							window.location.reload();
						}, 3000);
						return false;
					}
					$.each(data.responseJSON, function (key, value) {
						//var input = '#AskteleForm input[name=' + key + ']';
						//alert(key);
						//$(input + '+span>strong').text(value);
						//alert(value);

						if($.isPlainObject(value)) {
							$.each(value, function (key, value) {
								//alert(key+ " " +value);
								var err_co = "."+key+"Err";
								$(err_co).show().append(value+"<br/>");
							});
						}
						//$(input).parent().parent().addClass('has-error');
					});
				}
			});
			// $("#AskteleForm").submit();
            // document.AskteleForm.submit();
        }else {
            return false;
        }

	}
	</script>
